import React from 'react'

function Profile() {
    return (
        <div>
            <h1>John Do</h1>
            <p>Username: <strong>JohnDoe</strong></p>
            <p>E-mail: <strong>JohnDoe@test.com</strong></p>
        </div>
    )
}

export default Profile
